// Cards.jsx
import React from "react";
import useCardsApi from "../../hooks/useCardsApi";
import styleCards from "./Cards.module.css";
import useAddCards from "./useAddCards";

const Cards = () => {
  const [cards, loading, error] = useCardsApi();
  const { isClick, addCard, handleSubmit } = useAddCards();

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  if (!cards || cards.length === 0) {
    return <div>No cards found</div>;
  }

  return (
    <div className={styleCards.container_cards}>
      <div className={styleCards.frontCard}>
        <h1>Cards</h1>
        <ul className={styleCards.listOfCards}>
          {cards.slice(0, 3).map((card) => (
            <li className={styleCards.item} key={card._id}>
              <img
                className={styleCards.imgCards}
                src={card.image.url}
                alt={card.alt}
              />
              <h2>{card.title}</h2>
              <p className={styleCards.p}> {card.subtitle}</p>
              <p className={styleCards.p}>{card.address.country}</p>
            </li>
          ))}
        </ul>
        <button onClick={addCard}>+</button>
        {isClick && <form className={styleCards.form} onSubmit={handleSubmit}>
          <div className={styleCards.sectionOne}>
           <input className={styleCards.input}  type="text" name="title" placeholder="Title*" required />
           <input className={styleCards.input}  type="text" name="subtitle" placeholder="Subtitle*" required />
          </div>
           <input className={styleCards.input} type="text" name="description" placeholder="Description*" required />
          <div className={styleCards.sectionTwo}>
           <input className={styleCards.input} type="tel" name="phone" placeholder="Phone*" required />
           <input className={styleCards.input} type="email" name="email" placeholder="Email*" required />
          </div>
            <input className={styleCards.input} type="url" name="web" placeholder="Web (URL for the website)" />
           <div className={styleCards.sectionThree}>
           <input className={styleCards.input} type="url" name="imageUrl" placeholder="Image URL" />
           <input className={styleCards.input} type="text" name="imageAlt" placeholder="Image Alt" />
          </div>
            <input className={styleCards.input} type="text" name="city" placeholder="City*" required />
          <input className={styleCards.input} type="text" name="country" placeholder="Country*" required />
          <input className={styleCards.input} type="text" name="state" placeholder="State" />
          <input className={styleCards.input} type="text" name="street" placeholder="Street*" required />
          <input className={styleCards.input} type="text" name="houseNumber" placeholder="House Number*" required />
          <input className={styleCards.input} type="text" name="zip" placeholder="Zip*" required />
          </form>}
      </div>
    </div>
  );
};

export default Cards;
